// src/components/Receipts.tsx
import React from 'react';
import { Box, Paper, Typography } from '@mui/material';

const Receipts: React.FC = () => {
  return (
    <Box>
      <Paper sx={{ p: 3 }}>
        <Typography variant="h4" gutterBottom>Receipt Processing</Typography>
        <Typography>
          This page will allow employees to upload pictures of receipts. The AI will extract relevant data and store it for record-keeping.
        </Typography>
      </Paper>
    </Box>
  );
};

export default Receipts;
